// About.js

import React from 'react';

function About() {
  return (
    <div>
      <h2>About Page</h2>
      <p>Welcome to Tropical Tunda - Delivering Freshness, Sharing Kindness</p>
      <p>
        At Tropical Tunda, we believe that good food should be accessible to
        everyone. Our journey began with a simple idea: to connect those with
        an abundance of fresh fruits to those in need. What started as a small
        initiative has grown into a thriving community-driven platform that
        bridges the gap between surplus and scarcity.
      </p>
      <h3>Our Mission</h3>
      <p>
        We are on a mission to spread health, happiness, and hope through the
        goodness of fresh fruits. Our goal is to make it easy for you to enjoy
        nature's bounty while also giving back to the community.
      </p>

    </div>
  );
}

export default About;
